//https://github.com/MrMufflon/Leaflet.Coordinates
function addLatLng(map){
	L.control.coordinates({
			position:"bottomright",
			decimals:6,
			decimalSeperator:",",
			labelTemplateLat:"Lat: {y}",
			labelTemplateLng:"Lng: {x}"
		}).addTo(map);
	L.control.coordinates({
		position:"bottomright",
		useDMS:true,
		labelTemplateLat:"N {y}",
		labelTemplateLng:"E {x}",
		useLatLngOrder:true
	}).addTo(map);
}
